css:
@-moz-document domain("192.168.1.1"), domain("funbox.home") {
body {
    color: #fff;
    background: #222;
}
#document-background-footer {
    background: #222;
}

h1, h6 {
    color: rgb(255, 102, 0);
}
.input-text {
    background: #555;
    color: #fff;
}
.input-text:focus, select:focus {
    color: #000;
    border: 1px solid rgb(255, 85, 0);
}
ul.lbx2vmenu li a {
    color: #fff;
    background: #555;
}
#content-left ul li {
    border-bottom: 1px solid #999;
}
#content-left ul li.lbx2menuseparator {
    background: #222 none repeat scroll 0% 0%;
    height:2px;
}
body.accessibility-contrast1 ul.hmenu-advconfig li a span, body.accessibility-contrast1 ul.hmenu-systeminformation a span, body.log .desktop .form-container .log-button {
    color: #fff;
    border-radius: 10px;
}
ul.hmenu-advconfig li.last a, ul.hmenu-systeminformation li.last a {
    border-right: 0px solid rgb(188, 188, 188);
}
body.log .desktop .container, article header, #main #container #content article {
    background-color: #333;
}
header nav ul.navigation {
    height: 35px;
    border-bottom: 0px solid #1f1f1f;
}
header nav {
    border-radius: 10px;
}
#imageHorizontal, .help-container-pl {
    height: 0px;
    color: #222;
}
#status-container {
    height: 510px !important;
}
#main #container #content article {
    border-radius: 10px;
}
header nav ul.navigation li.navigation {
    border-left: 0px solid #000;
    border-right: 0px solid #000;
}
header nav ul.navigation li.navigation.start {
    border-radius: 10px 0px 0px 10px;
}
body.log .desktop .form-container {
    padding: 180px;
}
.article-content {
    border-left: 0px solid #000;
    border-right: 0px solid #000;
    border-top: 0px solid #1e1e1e;
}
article h3 {
    border-bottom: 1px solid #fff;
}
header div.dropdown li a {
    color: #fff;
    background: #111;
    border-radius: 10px;
    border: 0px solid #555;
}
.dropdown {
    background-color: #111;
    border: 0px solid #fff;
    -webkit-border-radius: 10px;
    -moz-border-radius: 10px;
    border-radius: 10px;
    -webkit-box-shadow: 0px 0px 0px #000;
    -moz-box-shadow: 0px 0px 0px #000;
    box-shadow: 0px 0px 0px #000;
}
header div.dropdown li {
    border-bottom: 0px solid #fff;
    border-top: 0px solid #fff;
}
#main-information, #main-information1 {
	border-bottom: 1px solid #333;
}
input[type="submit"]:focus, input[type="image"]:focus, input[type="reset"]:focus, input[type="button"]:focus, input[type="radio"]:focus {
	outline: rgb(255, 85, 0) solid 2px;
	border-radius: 3pt;
	/*box-shadow: 0 0 3pt 20pt rgb(255, 85, 0);*/
    box-shadow: inset 0 0 3px rgb(255, 85, 0);
}
table.array thead th {
	background-color: #333;
}
table.array td, table.array th {
	border: 1px solid #333;
}
table.array tbody td {
	background-color: #444;
    color: #fff;
}
table.array thead tr.subheader th {
	color: #fff;
	background-color: #444;
}
table.array tbody td .input-text, table.array tbody td select {
	background: #555;
    color: #fff;
    border-radius: 5px;
    border: 2px solid #666;
}

table.array tbody td .input-text {
	width: 100px;
}
body.accessibility-contrast1 table.array thead tr.subheader th {
	color: #fff;
}
ul.hmenu li a, ul.hmenu li a:hover, ul.hmenu li a:visited {
	background: #FF6600;
}
a:focus, a:active {
    border: 0px solid red;
}
#header-hmenu ul li a {
	background: #555;
    color: #fff
}
#header-hmenu ul li.active a, #header-hmenu ul li.active a:hover {
	background: #888;
	color: #fff;
}
#header-hmenu ul li a:hover, #header-hmenu ul li a:focus {
	background: #FF6600;
	color: #fff;
}
#header-controls {
	width: 0px;
}
body.log .desktop .form-container input:first-of-type {
    border-radius: 5px;
    border: 2px solid #666;
	background-color: #555;
    color: #333;
}
body.log .desktop .form-container input:last-of-type {
	border-radius: 5px;
    border: 2px solid #666;
	background-color: #a0a0a0;
    color: #000;
}
#hmenu-home-otg > a:nth-child(1){
	padding: 0px !important;
    width: 0px;
}
#hmenu-advconfig{
	border-right: 0px solid rgb(180,180,180) !important;
}
#StaticIP\.Chaddr{
    width: 20ex !important;
}





div.input-info-help div.header {
    background-image: url("https://i.ibb.co/yPxRvTx/input-info-help-header.png");
}
div.input-info-help div.content {
    background-image: url("https://i.ibb.co/9HWKkM0/input-info-help-middle.png");
}
div.input-info-help div.footer {
    background-image: url("https://i.ibb.co/WWsvkgk/input-info-help-footer.png");
}
.input-btn {
    background-image: url("https://i.ibb.co/j5w7nJR/buttons-factory.png");
}
#header-logo-livebox, #header-logo-liveboxFB2, a.header-livebox {
    background-image: url("https://i.ibb.co/GVJ4H9k/header-logo-funbox3.png");
}
ul.hmenu-advconfig li a, ul.hmenu-systeminformation a {
    background: rgba(0, 0, 0, 0) url("https://i.ibb.co/ZHVMCW9/hmenu.png") repeat scroll 0px 0px;
}
ul.hmenu-advconfig li.active a, ul.hmenu-systeminformation li.active a {
    background: transparent url("https://i.ibb.co/ZHVMCW9/hmenu.png") repeat scroll -148px 0px;
}
}
